/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution
{
public:
    TreeNode *deleteNode(TreeNode *root, int key)
    {
        TreeNode* pre = root;
        TreeNode* node = root;
        TreeNode* result = root;
        int leftOrRight = -1;
        // 找到当前节点
        while (node != nullptr)
        {
            if(node->val == key){
                break;
            } else if(key > node->val){
                leftOrRight = 1;
                pre = node;
                node = node->right;
            }else{
                leftOrRight = 0;
                pre = node;
                node = node->left;
            }
        }
    //printf("val =%d ",node->val);
    // 数字不存在
    if(node==nullptr)
      return root;
    // 找到数字后将其删除
    // 是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    // 不是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    TreeNode* l=node->left;
    TreeNode* r=node->right;

    if(node==root){
      if(l==nullptr&&r==nullptr)
        return nullptr;
      if(l==nullptr)
        return r; 
      if(r==nullptr)
        return l;
      TreeNode* newRoot=l;
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      return newRoot;
    } else {
      if(l==nullptr&&r==nullptr){

        if(leftOrRight==0){
          pre->left=nullptr;
        }
        if(leftOrRight==1){
          pre->right=nullptr;
        }

        return root;
      }
      if(l==nullptr){
        if(leftOrRight==0){
          pre->left=r;
        } else {
          pre->right=r;
        }
        return root;
      }
      if(r==nullptr){
        if(leftOrRight==0){
          pre->left=l;
        } else {
          pre->right=l;
        }
      return root;
      }
      // 直接将左子树接上去,右子树放到左子树的最大键值的右子树
      if(leftOrRight==0){
        pre->left=l;
      } else {
        pre->right=l;
      }
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      //printf("new l val = %d ",l->val);

        return root;
    }

  }
};

