class Solution {
  public char firstUniqChar(String s) {
    int[] hashTable = new int[128]; 
    char[] charArray = s.toCharArray();   
    for( char c : charArray){
      hashTable[c]++;
    }
    for( char c : charArray){
      if( hashTable[c] == 1){
        return c;
      }
    }
    return ' ';
  }

}

